import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter , Switch, Route, Link, Redirect, withRouter, useHistory }from "react-router-dom";
import ProtectedRoute from "./protectedRoute";
import Profile from "./profile";
import isLoggedIn from "./App"

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter >

      <Route exact path="/"> <Redirect to="/App" component={App} /> </Route>
      <ProtectedRoute path="/profile" component={Profile} isAuth={isLoggedIn}/>
  </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
